import { makeStyles } from '@material-ui/core'

const useStyles = makeStyles(() => ({
    loginForm : {
      maxWidth : '400px',
      display : 'flex', 
      flexDirection : 'column', 
      alignItems : 'center', 
      justigyContent : 'center',
      padding : '2px',
      margin : 'auto', 
      marginTop : '70px',
      boxShadow : '10px 10px 20px #ccc',
      borderRadius : '5px'
    }
  }))

module.exports = {
    useStyles
}
